import {Row,Col,Container} from 'reactstrap';

const Section=()=>{
    return(
        <Row>
        <Col md="4">
              <h1>hello4</h1>
        </Col>

        <Col md="8">
        <h1>hello8</h1>
        </Col>

      </Row>
    )
}
export default Section;
